const express = require("express");
const router = express.Router();
const ObjectId = require("mongodb").ObjectId;
const { Listing } = require("../models");

router.route("/get-listing").get(async function (req, res) {
  // Empty `filter` means "match all documents"
  const filter = {
    isAvailable: true,
  };
  await Listing.find()
    .populate("createdBy")
    .populate("requested")
    .then((response) => {
      res.json(response);
    });
});

router.get("/get-image", async (req, res) => {
  const imageBase64 =
    "";
  //   return res.sendFile(imageBase64);
  //   const data = imageBase64.split(",")[1]; // Remove the "data:image/jpeg;base64," part

  const imgBuffer = Buffer.from(imageBase64, "base64");

  res.writeHead(200, {
    "Content-Type": "image/jpeg", // Use the correct image type (jpeg in this case)
    "Content-Length": imgBuffer.length,
  });
  res.end(imgBuffer);
});

router.post("/upload-image", async (req, res) => {
  if (!req.body.image) {
    res.sendStatus(500);
    return;
  }
  // PROTECT
  try {
    filter = { _id: req.body.listingId, createdBy: req.user._id };
    await Listing.findOne(filter)
      .populate("createdBy")
      .then(async (response) => {
        console.log(response);
        let { createdBy } = response;
        if (createdBy._id.toString() == req.user._id) {
          data = await Listing.findOneAndUpdate(filter, req.body.updateInfo, {
            new: true, // Returns updated
          });
          res.json(data);
          return;
        }
        res.sendStatus(500);
      });
  } catch (err) {
    res.sendStatus(500);
  }
});

module.exports = router;
